import React from 'react'

function PopUp({closepopupHandler, popupItems , allDishes}) {

    let popupDishes = allDishes.filter((item)=>{
        return(
            item.strMeal === popupItems
        )
    }).map((item)=>{
        return(
            <div className='popup-content-data'>
                <div className="popup-header">
                 <img src={item.strMealThumb} alt="" />
                 <h5 className='popup-header-category'>{item.strCategory}</h5>
                </div>
                <h2>{item.strMeal}</h2>



            </div>

        )
    })
  return (
    <div className='popup'>
        <div className="popup-content">
            {popupDishes}
            <button>Order Now</button>
            <h5 className='popup-close' onClick={closepopupHandler}>Close</h5>
        </div>
    </div>
  )
}

export default PopUp
